import React from 'react';
import { FormFeedbackStyled, InputBoxStyled } from './inputbox.style';

function InputBox({children, ...rest}) {
    return (
        <>
            <InputBoxStyled {...rest}>
                {children}
            </InputBoxStyled>
            <FormFeedbackStyled>

            </FormFeedbackStyled>
        </>
    );
}

export default InputBox;
